<script>
import * as PIXI from 'pixi.js'
import NEAT from 'neataptic'
import * as Chart from 'chart.js'
const Simulation = require('thesis-simulation').default

function initChart () {
  let chartCanvas = document.getElementById('chart').getContext('2d')
  return new Chart(chartCanvas, {
    type: 'line',
    data: {
      labels: [],
      datasets: [{
        label: 'fitness',
        data: []
      }]
    },
    options: {
      animation: false
    }
  })
}

PIXI.loader
  .add('./static/chassis.png')
  .add('./static/wheel.png')
  .load()

export default {
  name: 'Player',
  mounted: function () {
    this.chart = initChart()
    this.simulation = new Simulation(1000, document.getElementById('player'), PIXI.loader)
    let t = this
    let running = false
    let i = 0
    let interval = null
    document.getElementById('playButton').onclick = function () {
      running = true
      clearInterval(interval)
      let json = JSON.parse(document.getElementById('jsonInput').value)
      let genome = NEAT.Network.fromJSON(json)
      t.simulation.positions = json.positions
      t.simulation.evaluate(genome, json.piece, {player: true, piece: json.piece, fitness: 0}).then(function () {
        running = false
        i = 0
        clearInterval(interval)
      })
      interval = setInterval(update, 16)
      t.chart.data.datasets[0].data = []
      t.chart.data.labels = []
    }
    function update () {
      if (!running || t.simulation.positions.length === 0 || !t.simulation.car) return
      let info = t.simulation.positions.shift()
      let body = t.simulation.car.getComponent('physics').body
      body.position = [info.spaceInfo[0], info.spaceInfo[1]]
      body.angle = info.spaceInfo[2]
      let carComponent = t.simulation.car.getComponent('car')
      if (!carComponent.options) return
      carComponent.options.fitness = info.fitness
      carComponent.options.piece = info.piece
      i += 1
      t.simulation.update(1 / 60.0)
      if (i % 60 === 0 || t.simulation.positions.length === 0) {
        t.chart.data.datasets[0].data.push(info.fitness)
        t.chart.data.labels.push(t.chart.data.datasets[0].data.length)
        t.chart.update()
      }
    }
  }
}
</script>

